INSERT INTO `dapp_currency` VALUES ('BTC', '比特币', '比特幣', 'Bitcoin', 1, 2, '2008-11-01', '21000000', '16738200', ' ', 'https://bitcoin.org/bitcoin.pdf', 'https://bitcoin.org/en/', 'https://blockchain.info/', ' 比特币（Bitcoin，简称BTC）是目前使用最为广泛的一种数字货币，它诞生于2009年1月3日，是一种点对点（P2P）传输的数字加密货币，总量2100万枚。比特币网络每10分钟释放出一定数量币，预计在2140年达到极限。比特币被投资者称为“数字黄金”。比特币依据特定算法，通过大量的计算产生，不依靠特定货币机构发行，其使用整个P2P网络中众多节点构成的分布式数据库来确认并记录所有的交易行为，并使用密码学设计确保货币流通各个环节安全性，可确保无法通过大量制造比特币来人为操控币值。基于密码学的设计可以使比特币只能被真实拥有者转移、支付及兑现。同样确保了货币所有权与流通交易的匿名性。', 'Bitcoin is a digital asset and a payment system invented by Satoshi Nakamoto who published a related paper in 2008 and released it as open-source software in 2009. The system featured as peer-to-peer; users can transact directly without an intermediary. Transactions are verified by network nodes and recorded in a public distributed ledger called the blockchain. The ledger uses bitcoin as its unit of account. The system works without a central repository or single administrator, which has led the U.S. Treasury to categorize bitcoin as a decentralized virtual currency. Bitcoin is often called the first cryptocurrency, although prior systems existed. Bitcoin is more correctly described as the first decentralized digital currency. It is the largest of its kind in terms of total market value by now.', '比特幣（Bitcoin，簡稱BTC）是現時使用最為廣泛的一種數位貨幣，它誕生於2009年1月3日，是一種點對點（P2P）傳輸的數位加密貨幣，總量2100萬枚。比特幣網絡每10分鐘釋放出一定數量幣，預計在2140年達到極限。比特幣被投資者稱為“數位黃金”。比特幣依據特定算灋，通過大量的計算產生，不依靠特定貨幣機构發行，其使用整個P2P網絡中眾多節點構成的分散式資料庫來確認並記錄所有的交易行為，並使用密碼學設計確保貨幣流通各個環節安全性，可確保無法通過大量製造比特幣來人為操控幣值。基於密碼學的設計可以使比特幣只能被真實擁有者轉移、支付及兌現。同樣確保了貨幣所有權與流通交易的匿名性。', 1);
INSERT INTO `dapp_currency` VALUES ('EOS', 'Enterprise Operation System', 'Enterprise Operation System', 'Enterprise Operation System', 1, 4, '2017-07-02', '1000000000', '536000000', ' ', 'https://github.com/EOSIO/Documentation/blob/master/TechnicalWhitePaper.md', 'https://eos.io/', 'https://eospark.com/', 'EOS (Enterprise Operation System)是由 Block.one公司主导开发的一种全新的基于区块链智能合约平台，旨在为高性能分布式应用提供底层区块链平台服务。EOS 项目的目标是实现一个类似操作系统的支撑分布式应用程序的区块链架构。该架构可以提供账户，身份认证，数据库，异步通信以及可在数以万计的 CPU/GPU群集上进行程序调度和并行运算。EOS最终可以支持每秒执行数百万个交易，同时普通用户执行智能合约无需支付使用费用。', 'EOS tokens are ERC-20 compatible tokens distributed on the Ethereum blockchain pursuant to a related ERC-20 smart contract (the “EOS Tokens”). EOS featured in powerful infrastructure for decentralized application and token distribution takes place over 341 days.', 'EOS (Enterprise Operation System)是由Block.one公司主導開發的一種全新的基於區塊鏈智慧合約平臺，旨在為高性能分佈式應用提供底層區塊鏈平臺服務。EOS項目的目標是實現一個類似作業系統的支撐分佈式應用程序的區塊鏈架構。該架構可以提供帳戶，身份認證，資料庫，非同步通信以及可在數以萬計的CPU/GPU羣集上進行程式調度和並行運算。EOS最終可以支持每秒執行數百萬個交易，同時普通用戶執行智慧合約無需支付使用費用。', 0);
INSERT INTO `dapp_currency` VALUES ('ETH', '以太坊', '以太坊', 'Ethereum', 1, 3, '2014-07-24', '96311500', '96311500', '$0.31', 'https://github.com/ethereum/wiki/wiki/White-Paper', 'https://www.ethereum.org/', 'https://etherscan.io/', ' 以太坊（Ethereum）是下一代密码学账本，可以支持众多的高级功能，包括用户发行货币，智能协议，去中心化的交易和设立去中心化自治组织(DAOs)或去中心化自治公司（DACs）。以太坊并不是把每一单个类型的功能作为特性来特别支持，相反，以太坊包括一个内置的图灵完备的脚本语言，允许通过被称为“合同”的机制来为自己想实现的特性写代码。一个合同就像一个自动的代理，每当接收到一笔交易，合同就会运行特定的一段代码，这段代码能修改合同内部的数据存储或者发送交易。', 'Ethereum is a decentralized platform that runs smart contracts: applications that run exactly as programmed without any possibility of downtime, censorship, fraud or third party interference. These apps run on a custom built blockchain, an enormously powerful shared global infrastructure that can move value around and represent the ownership of property.', '以太坊（Ethereum）是下一代密碼學帳本，可以支持眾多的高級功能，包括用戶發行貨幣，智慧協定，去中心化的交易和設立去中心化自治組織（DAOs）或去中心化自治公司（DACs）。以太坊並不是把每一單個類型的功能作為特性來特別支持，相反，以太坊包括一個內寘的圖靈完備的指令碼語言，允許通過被稱為“契约”的機制來為自己想實現的特性寫程式碼。一個契约就像一個自動的代理，每當接收到一筆交易，契约就會運行特定的一段程式碼，這段程式碼能修改契约內部的資料存儲或者發送交易。', 1);
INSERT INTO `dapp_currency` VALUES ('LTC', '莱特币', '莱特幣', 'Litecoin', 1, 2, '2011-11-09', '84000000', '54282600', ' ', 'https://bitcoin.org/bitcoin.pdf', 'https://litecoin.org/cn/', 'http://explorer.litecoin.net/chain/Litecoin', '莱特币诞生于2011年11月9日，被称为是“数字白银”。莱特币在技术上和比特币具有相同的实现原理。它第一个基于Scrypt算法的网络数字货币，与比特币相比，莱特币拥有更快的交易确认时间，更高的网络交易容量和效率。莱特币现在拥有完整的产业链，充分的流动性，足以证明其成熟、安全、稳定的商用金融系统。', 'Litecoin was born on November 9, 2011 and is known as \"digital silver\".Litecoin is technically the same as bitcoin.It is the first online digital currency based on Scrypt algorithm. Compared with bitcoin, litecoin has faster transaction confirmation time, higher online transaction capacity and higher efficiency.Litecoin now has a complete industrial chain and sufficient liquidity to prove its mature, safe and stable commercial financial system.', '萊特幣誕生於2011年11月9日，被稱為是“數字白銀”。萊特幣在技術上和比特幣具有相同的實現原理。它第壹個基於Scrypt算法的網絡數字貨幣，與比特幣相比，萊特幣擁有更快的交易確認時間，更高的網絡交易容量和效率。萊特幣現在擁有完整的產業鏈，充分的流動性，足以證明其成熟、安全、穩定的商用金融系統。', 1);
INSERT INTO `dapp_currency` VALUES ('TRX', '波场币', '波场币', 'TRX', 1, 2, '2017-09-14', '99214764539', '66682072191', '$0.0015', 'https://tron.network/static/doc/white_paper_v_2_0.pdf', 'https://tron.network/', 'hhttps://tronscan.org/', '波场TRON以推动互联网去中心化为己任，致力于为去中心化互联网搭建基础设施。旗下的TRON协议是全球最大的基于区块链的去中心化应用操作系统协 议之一，为协议上的去中心化应用运行提供高吞吐，高扩展，高可靠性的底层公链支持。波场TRON还通过创新的可插拔智能合约平台为以太坊智能合约提供更好的兼容性。\r\n自2018年7月24日起，TRON收购了位于旧金山的互联网技术公司BitTorrent Inc.。BitTorrent Inc.设计的分布式技术能够有效扩展，保持智能化，并使创作者和消费者能够控制其内容和数据。每个月有超过1.7亿人使用BitTorrent Inc.开发的产品。BitTorrent Inc.的协议每天可以传输全球40％的互联网流量。', 'With the mission of promoting Internet de-centralization, wave field TRON is committed to building infrastructure for the decentralized Internet.Its TRON protocol is one of the largest blockchain-based decentralized application operating system agreements in the world, providing high throughput, high expansion and high reliability of the underlying public chain support for decentralized application operation on the protocol.Wave field TRON also provides better compatibility for ethereum smart contracts with its innovative pluggable smart contract platform.', '波場TRON以推動互聯網去中心化為己任，致力於為去中心化互聯網搭建基礎設施。旗下的TRON協議是全球最大的基於區塊鏈的去中心化應用操作系統協 議之壹，為協議上的去中心化應用運行提供高吞吐，高擴展，高可靠性的底層公鏈支持。波場TRON還通過創新的可插拔智能合約平臺為以太坊智能合約提供更好的兼容性。\r\n自2018年7月24日起，TRON收購了位於舊金山的互聯網技術公司BitTorrent Inc.。BitTorrent Inc.設計的分布式技術能夠有效擴展，保持智能化，並使創作者和消費者能夠控制其內容和數據。每個月有超過1.7億人使用BitTorrent Inc.開發的產品。BitTorrent Inc.的協議每天可以傳輸全球40％的互聯網流量。', 1);
INSERT INTO `dapp_currency` VALUES ('USDT', 'Tether ', 'Tether ', 'Tether ', 1, 1, '2014-11-26', '869999400', '839017300', ' ', ' ', 'https://tether.to/', 'https://www.ominiexplorer.info/', 'USDT是Tether公司推出的基于稳定价值货币美元（USD）的代币Tether USD（下称USDT），1USDT=1美元，用户可以随时使用USDT与USD进行1:1兑换。Tether公司严格遵守1:1准备金保证，即每发行1个 USDT 代币，其银行账户都会有1美元的资金保障。用户可以在 Tether 平台进行资金查询，以保障透明度。用户可以通过SWIFT电汇美元至Tether公司提供的银行帐户，或通过交易所换取USDT。赎回美元时，反向操作即可。用户也可在交易所用比特币换取USDT。\r\n\r\nUSDT是在比特币区块链上发布的基于Omni Layer协议的数字资产。USDT最大的特点是，它与同数量的美元是等值的。USDT被设计为法币在数字网络上的复制品，使之成为波动剧烈的加密货币市场中良好的保值代币。', 'USDT is a cryptocurrency asset issued on the Bitcoin blockchain via the Omni Layer Protocol. Each USDT unit is backed by a U.S Dollar held in the reserves of the Tether Limited and can be redeemed through the Tether Platform. USDT can be transferred, stored, spent, just like bitcoins or any other cryptocurrency, users can transact and store tethers with any Omni Layer enabled wallet like Ambisafe, Holy Transaction or Omni Wallet.', 'USDT是Tether公司推出的基於穩定價值貨幣美元（USD）的代幣Tether USD（下稱USDT），1USDT=1美元，用戶可以隨時使用USDT與USD進行1:1兌換。Tether公司嚴格遵守1:1準備金保證，即每發行1個USDT代幣，其銀行帳戶都會有1美元的資金保障。用戶可以在Tether平臺進行資金査詢，以保障透明度。用戶可以通過SWIFT電匯美元至Tether公司提供的銀行帳戶，或通過交易所換取USDT。贖回美元時，反向操作即可。用戶也可在交易所用比特幣換取USDT。\n\n\n\nUSDT是在比特幣區塊鏈上發佈的基於Omni Layer協定的數位資產。USDT最大的特點是，它與同數量的美元是等值的。USDT被設計為法幣在數位網絡上的複製品，使之成為波動劇烈的加密貨幣市場中良好的保值代幣。', 1);
